// import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

class App extends Component {
  constructor() {
    super();
    this.state = {
      monsters: [
        { name: 'Frankestein' },
        { name: 'Dracula' },
        { name: 'Zombie' },
      ]
    }

  }
  render() {
    return (
      <div className="App">
        <h1>{this.state.mm}</h1>
        <button onClick={() => this.setState({ mm: 'test' })}>change state</button>
      </div>
    )
  };
}

export default App;
